import React from "react";

const Header = () => {
  return (
    <div className="flex justify-between bg-white shadow p-5  items-center shadow-lg ">
        <div className=" flex ">
        <h1 className=" text-3xl font-bold">EzCOde<span className="text-orange-400">Academy</span></h1>
        </div>


      <div className="">
        <ul className="flex items-center justify-center gap-5 font-semibold cursor-pointer">
          <li className="hover:bg-orange-600 ">Home</li>
          <li>Courses</li>
          <li>Pages</li>
          <li>Gallery</li>
          <li>Contact us</li>
        </ul>
      </div>



      <div className="flex justify-end gap-5 items-center">
        <p className="text-xl">Login</p>
       <div>
       <button className="border bg-orange-400 rounded-lg p-3">Register Now</button>
       </div>
      </div>

      
    </div>
  );
};

export default Header;
